planning is to set goals. And the best goals are always SMART. SMART goals means that the goals are Specific, Measurable, Achievable, Realistic and Timely. This could be training for an upcoming marathon, weekly nature trial hikes or even entering a physique competition. \n\n#02 Be a Persistent and Consistent Workout Partner\n\nAs all relationships are, being a workout partner to your friend(s) is a two way traffic too. When you show that you are persistent and consistent it will motivate your buddy to do so as well. And in turn it will help you someday, what goes around always come around. Empathy is key here, try to see things from their perspective and break them in gently.\n\nWe have two more tips for you and we will be sharing them in the next Fact Friday. So do follow us for the next GYMMBOXX Fact Friday! \n\n#GYMMBOXXFactFriday\n#GYMMBOXX\n#GYMMBOXXBedokPoint\n#GYMMBOXXCenturySquare\n#GYMMBOXXBishan\n#GYMMBOXXKebunBaru\n#GYMMBOXXJCube\n#GYMMBOXXKeatHong\n#GYMMBOXXCanberra\n#SupportLocal\n#StayHealthy\n\nCitations:\n4 Fitness Motivation Hacks for Friends. (2021). Retrieved January 22, 2021, from https://www.healthhub.sg/live-healthy/1008/6-ways-to-motivate-your-loved-ones-to-exercise"}}]},"edge_media_to_comment":{"count":0},"comments_disabled":false,"taken_at_timestamp":1611311582,"edge_liked_by":{"count":52},"edge_media_preview_like":{"count":-1},"location":null,"thumbnail_src":"https://instagram.fsin1-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c1.0.1438.1438a/s640x640/140581715_219886063148679_4934966403865655218_n.jpg?_nc_ht=instagram.fsin1-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=ATMdIMZOrq0AX8qzzKN\u0026tp=1\u0026oh=c7b1f7120f9ab2debabf5931d18b931d\u0026oe=604D0993","thumbnail_resources":[{"src":"https://instagram.fsin1-1.fna.fbcdn.net/v/t51.2885-15/e35/c1.0.1438.1438a/s150x150/140581715_219886063148679_4934966403865655218_n.jpg?_nc_ht=instagram.fsin1-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=ATMdIMZOrq0AX8qzzKN\u0026tp=1\u0026oh=91e5c5edbb2863a03b
